import React from "react";
import { Link } from "react-router-dom";

const Welcome = () => {
  return (
      <div className="welcome">
          <img src={require("../assets/pair-logo-small.png")} width="356" height="300" alt="pair logo" />
          <video width="300" height="300" autoplay>
          <source src="../assets/Logo Video 2.mp4" type="video/mp4" />
          Your browser does not support the video tag.
          </video>
      <p>Welcome</p>
          <Link to="/modeselect">
          <p>Wine=>Food / Food=>Wine</p>
        </Link>
    </div>
  );
};

export default Welcome;
